package HackerRank;class BiCycle{    String defineMe(){        return "a vehicle with pedals.";    }}class MotorCycle extends BiCycle{    @Override    String defineMe(){        return "a cycle with an engine.";    }    MotorCycle(){        System.out.println("Hello I am a motorcycle, I am "+ defineMe());        final String temp = super.defineMe();        System.out.println("My ancestor is a cycle who is "+ temp);    }}public class JavaMethodOverriding2Super {    public static void main(String[] args) {        new MotorCycle(); /*Anonymous object*/    }}